import React from "react";

const Pokemon = () => {
  const [sets, setPokemons] = React.useState([]);
  React.useEffect(() => {
    fetch("https://api.tcgdex.net/v2/en/sets").then((res) => res.json())
    .then((json) => {
      setPokemons(json);
    });
}, []);
return (
  <div className="Pokemon">
    <h1> All Pokemon trading card game official play sets:</h1>
    {sets.map((set) => (
      <ul key={set.id}>
        <li>
          Set's name: {set.name}
          <br /> Total cards annouced: {set.cardCount.total}
          <br /> Offical cards released: {set.cardCount.official}
        </li>
      </ul>
    ))}
  </div>
);
};


export default Pokemon;
